(8, 'Popkart', 'Sign up Verification From Popkart', 'signup', '<meta charset=\"utf-8\">\r\n	<title></title>\r\n\r\n\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n			<tbody>\r\n				<tr>\r\n					<th style=\" vertical-align: middle;text-align: center;  height:  80px;\">\r\n				 		<img src=\"http://popkart.eoxysitsolution.com/assets/images/popkart.png\" style=\"max-width: 140px; cursor: default;\">\r\n					</th>\r\n				</tr>\r\n			\r\n				<tr>\r\n					<th style=\"background:#29a6ca;padding: 30px;\">\r\n						\r\n						<h2 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-weight: 800; font-size: 34px; font-family: Raleway, sans-serif; color: rgb(255, 255, 255); text-align: center;\">Sign Up</h2>\r\n					</th>\r\n					\r\n				</tr>\r\n\r\n				<tr>\r\n					<th style=\"padding:40px 40px 0px 40px;\">\r\n						<h5 align=\"left\" style=\"margin: 0px;font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600;\">Hello {email}</h5>\r\n						<h6 align=\"left\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53; line-height: 20px;  margin: 20px 0px;\">Welcome To Popkart.</h6>\r\n						<p style=\"border-collapse: collapse; border-bottom: 1px solid #eaedf1;padding: 0 0px 30px 0;\"><br>Your One Time Password is: {password}</p>\r\n<br>\r\n<p>Thank You<br>\r\nPopkart</p><br></th></tr>\r\n			</tbody>\r\n		</table>', 'user', 'kamalkumawato398@gmail.com', 'kamalkumawato398@gmail.com', 'Popkart', '2022-02-18 01:24:56', '2022-04-20 11:32:51'),
(9, 'Popkart', 'Forget Password Verification From Popkart', 'forget_password', '<meta charset=\"utf-8\">\r\n	<title></title>\r\n\r\n\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n			<tbody>\r\n				<tr>\r\n					<th style=\" vertical-align: middle;text-align: center;  height:  80px;\">\r\n				 		<img src=\"http://popkart.eoxysitsolution.com/assets/images/popkart.png\" style=\"max-width: 140px; cursor: default;\">\r\n					</th>\r\n				</tr>\r\n			\r\n				<tr>\r\n					<th style=\"background:#29a6ca;padding: 30px;\">\r\n						\r\n						<h2 style=\"font-size: 34px; text-align: center; font-family: \'Raleway\', sans-serif; font-weight: 800;  color: #fff;margin: 0;\">Forget Password</h2>\r\n					</th>\r\n					\r\n				</tr>\r\n\r\n				<tr>\r\n					<th style=\"padding:40px 40px 0px 40px;\">\r\n						<h5 align=\"left\" style=\"margin: 0px;font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600;\">Hi {name} ({email})</h5><p style=\"margin: 0px;\"><font face=\"Raleway, sans-serif\"><span style=\"font-size: 16px;\"><br></span></font></p><p style=\"margin: 0px;\"><font face=\"Raleway, sans-serif\"><span style=\"/* font-size: 16px; */font-weight: 600;\">If you did not make this request then please ignore this email.</span></font><br></p>\r\n						<p style=\"border-collapse: collapse; border-bottom: 1px solid #eaedf1;padding: 0 0px 30px 0;\"><br>Your One Time Password is: {password}</p><br>\r\n<p>Thank You<br>\r\nPopkart</p><br></th></tr>\r\n			</tbody>\r\n		</table>', 'user', 'kamalkumawato398@gmail.com', 'kamalkumawato398@gmail.com', 'Popkart', '2022-02-21 07:36:03', '2022-04-20 11:42:45'),
(10, 'Popkart', 'Registration Successful', 'signup_success', '<meta charset=\"utf-8\">\r\n	<title></title>\r\n\r\n\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n			<tbody>\r\n				<tr>\r\n					<th style=\" vertical-align: middle;text-align: center;  height:  80px;\">\r\n				 		<img src=\"http://popkart.eoxysitsolution.com/assets/images/popkart.png\" style=\"max-width: 140px; cursor: default;\">\r\n					</th>\r\n				</tr>\r\n			\r\n				<tr>\r\n					<th style=\"background:#29a6ca;padding: 30px;\">\r\n						\r\n						<h2 style=\"font-size: 34px; text-align: center; font-family: \'Raleway\', sans-serif; font-weight: 800;  color: #fff;margin: 0;\">Registration Successful</h2>\r\n					</th>\r\n					\r\n				</tr>\r\n\r\n				<tr>\r\n					<th style=\"padding:40px 40px 0px 40px;\">\r\n						<h5 align=\"left\" style=\"margin: 0px;font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600;\">Hi {name}</h5>\r\n						<h6 align=\"left\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53; line-height: 20px;  margin: 20px 0px;\">Welcome To Popkart</h6>\r\n<h6 align=\"left\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53; line-height: 20px;  margin: 20px 0px;\">Your Email: {email} Has Been Registered Successfully With Us.</h6>\r\n						<p style=\"border-collapse: collapse; border-bottom: 1px solid #eaedf1;padding: 0 0 30px 0;\">Your Email ID: {email}<br>Your Password: {password}</p><br>\r\n<p>Thank You<br>\r\nPopkart</p><br></th></tr>\r\n			</tbody>\r\n		</table>', 'user', 'kamalkumawato398@gmail.com', 'kamalkumawato398@gmail.com', 'Popkart', '2022-03-29 04:32:25', '2022-04-20 11:45:34'),
(11, 'Popkart', 'Password Reset Successful', 'password_reset', '<meta charset=\"utf-8\">\r\n	<title></title>\r\n\r\n\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n			<tbody>\r\n				<tr>\r\n					<th style=\" vertical-align: middle;text-align: center;  height:  80px;\">\r\n				 		<img src=\"http://popkart.eoxysitsolution.com/assets/images/popkart.png\" style=\"max-width: 140px; cursor: default;\">\r\n					</th>\r\n				</tr>\r\n			\r\n				<tr>\r\n					<th style=\"background:#29a6ca;padding: 30px;\">\r\n						\r\n						<h2 style=\"font-size: 34px; text-align: center; font-family: \'Raleway\', sans-serif; font-weight: 800;  color: #fff;margin: 0;\">Password Reset Successful</h2>\r\n					</th>\r\n					\r\n				</tr>\r\n\r\n				<tr>\r\n					<th style=\"padding:40px 40px 0px 40px;\">\r\n						<h5 align=\"left\" style=\"margin: 0px; font-size: 16px; font-family: Raleway, sans-serif;\"><b>Hello {name}</b></h5>\r\n						<h6 align=\"left\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53; line-height: 20px;  margin: 20px 0px;\">Your Password Has Been Updated Successfully.&nbsp;</h6><p style=\"font-size: 15px; font-family: Raleway, sans-serif; font-weight: 400; color: rgb(76, 76, 83); line-height: 20px; margin: 20px 0px;\"><br></p>\r\n						<p style=\"border-collapse: collapse; border-bottom: 1px solid #eaedf1;padding: 0 0 30px 0;\">Your Email ID:&nbsp;{email}<br>Your New Password: {password}</p><br>\r\n<p>Thank You<br>\r\nPopkart</p><br></th></tr>\r\n			</tbody>\r\n		</table>', 'user', 'kamalkumawato398@gmail.com', 'kamalkumawato398@gmail.com', 'Popkart', '2022-03-29 05:05:19', '2022-04-20 11:48:57'),
(12, 'popkart', 'User Invitation', 'user_invitation', '<meta charset=\"utf-8\">\r\n	<title></title>\r\n\r\n\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n			<tbody>\r\n				<tr>\r\n					<th style=\" vertical-align: middle;text-align: center;  height:  80px;\">\r\n				 		<img src=\"http://popkart.eoxysitsolution.com/assets/images/popkart.png\" style=\"max-width: 140px; cursor: default;\">\r\n					</th>\r\n				</tr>\r\n			\r\n				<tr>\r\n					<th style=\"background:#29a6ca;padding: 30px;\">\r\n						\r\n						<h2 style=\"font-size: 34px; text-align: center; font-family: \'Raleway\', sans-serif; font-weight: 800;  color: #fff;margin: 0;\">User Invitation</h2>\r\n					</th>\r\n					\r\n				</tr>\r\n\r\n				<tr>\r\n					<th style=\"padding:40px 40px 0px 40px;\">\r\n						<h5 align=\"left\" style=\"margin: 0px; font-family: Raleway, sans-serif;\"><span style=\"color: rgb(76, 76, 83); font-size: 15px; text-align: inherit;\"><b>Dear {receiver},</b></span><br></h5><p style=\"font-size: 15px; font-family: Raleway, sans-serif; font-weight: 400; color: rgb(76, 76, 83); line-height: 20px; margin: 20px 0px;\">Hope you are doing well. I am using Popcart and I have sent an invitation to you to join this app. Join and enjoy the Popcart features. <a href=\"{link}\">Click Here</a></p><p style=\"font-size: 15px; font-family: Raleway, sans-serif; font-weight: 400; color: rgb(76, 76, 83); line-height: 20px; margin: 20px 0px;\"><br></p>\r\n\r\n\r\n\r\n<p style=\"font-size: 15px; font-family: Raleway, sans-serif; color: rgb(76, 76, 83); line-height: 20px; margin: 20px 0px;\">Thank you</p></th></tr>\r\n			</tbody>\r\n		</table>', 'user', 'kamalkumawato398@gmail.com', 'kamalkumawato398@gmail.com', 'popkart', '2022-04-19 12:27:35', '2022-05-13 07:05:52'),
(13, 'Popkart', 'Subscription Plan Updated', 'subscription_plan_updated', '<meta charset=\"utf-8\">\r\n	<title></title>\r\n\r\n\r\n<table style=\"max-width: 600px;box-shadow: 0 8px 24px #e5e4e6; margin: 0px auto; height:  80px; background: #fff; width: 100%;\">\r\n			<tbody>\r\n				<tr>\r\n					<th style=\" vertical-align: middle;text-align: center;  height:  80px;\">\r\n				 		<img src=\"http://popkart.eoxysitsolution.com/assets/images/popkart.png\" style=\"max-width: 140px; cursor: default;\">\r\n					</th>\r\n				</tr>\r\n			\r\n				<tr>\r\n					<th style=\"background:#29a6ca;padding: 30px;\">\r\n						\r\n						<h2 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-weight: 800; font-size: 34px; font-family: Raleway, sans-serif; color: rgb(255, 255, 255); text-align: center;\">Subscription Plan Updated</h2>\r\n					</th>\r\n					\r\n				</tr>\r\n\r\n				<tr>\r\n					<th style=\"padding:40px 40px 0px 40px;\">\r\n						<h5 align=\"left\" style=\"margin: 0px;font-size: 16px; font-family: \'Raleway\', sans-serif; font-weight: 600;\">Hello {name}</h5>\r\n						<h6 align=\"left\" style=\"font-size: 15px; font-family: \'Raleway\', sans-serif; font-weight: 400; color:#4c4c53; line-height: 20px;  margin: 20px 0px;\">Your Subscription plan was updated successfully with the plan: {plan}.</h6><p style=\"font-size: 15px; font-family: Raleway, sans-serif; color: rgb(76, 76, 83); line-height: 20px; margin: 20px 0px;\">Price: {price}</p>\r\n						<p style=\"border-collapse: collapse; border-bottom: 1px solid #eaedf1;padding: 0 0px 30px 0;\"><br></p>\r\n<br>\r\n<p>Thank You<br>\r\nPopkart</p><br></th></tr>\r\n			</tbody>\r\n		</table>', 'user', 'kamalkumawato398@gmail.com', 'kamalkumawato398@gmail.com', 'Popkart', '2022-04-21 07:33:29', '2022-04-21 07:39:09');
