INSERT INTO `pages` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(8, 'Privacy Policy', '<h1 style=\"margin: 24pt 0cm 10pt; text-align: center; line-height: 30.6667px; break-after: avoid; font-size: 20pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Privacy policy<o:p></o:p></span></h1><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">This privacy policy applies between you, the User of this </span><span lang=\"EN-US\">Mobile App </span><span lang=\"EN-GB\">and </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\">, the owner and provider of this </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">. </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> takes the privacy of your information very seriously. This privacy policy applies to our use of any and all Data collected by us or provided by you in relation to your use of the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">. <b>Please read this privacy policy carefully</b>.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Definitions and interpretation<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;1. </span><span lang=\"EN-GB\">In this privacy policy, the following definitions are used:<o:p></o:p></span></p><table class=\"MsoNormalTable\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"605\" style=\"margin-left: 2.75pt; border: none;\"><tbody><tr><td width=\"298\" valign=\"top\" style=\"width: 223.75pt; border-top: 1pt solid black; border-left: none; border-bottom: 1pt solid black; border-right: none; padding: 2.75pt;\"><p class=\"DefinitionDescription\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><b><span lang=\"EN-GB\">Data</span></b><span lang=\"EN-GB\"><o:p></o:p></span></p></td><td width=\"307\" valign=\"top\" style=\"width: 230.3pt; border-top: 1pt solid black; border-left: none; border-bottom: 1pt solid black; border-right: none; padding: 2.75pt;\"><p class=\"DefinitionDescription\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">collectively all information that you submit to </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> via the </span><span lang=\"EN-US\">App</span><span lang=\"EN-GB\">. This definition incorporates, where applicable, the definitions provided in the Data Protection Act 1998;<o:p></o:p></span></p></td></tr><tr><td width=\"298\" valign=\"top\" style=\"width: 223.75pt; border-top: none; border-right: none; border-left: none; border-image: initial; border-bottom: 1pt solid black; padding: 2.75pt;\"><p class=\"DefinitionDescription\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><b><span lang=\"EN-GB\">User</span></b><span lang=\"EN-GB\"> or <b>you</b><o:p></o:p></span></p></td><td width=\"307\" valign=\"top\" style=\"width: 230.3pt; border-top: none; border-right: none; border-left: none; border-image: initial; border-bottom: 1pt solid black; padding: 2.75pt;\"><p class=\"DefinitionDescription\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">any third party that accesses the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">and is not either (i) employed by </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> and acting in the course of their employment or (ii) engaged as a consultant or otherwise providing services to </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> and accessing the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">in connection with the provision of such services; and<o:p></o:p></span></p></td></tr><tr><td width=\"298\" valign=\"top\" style=\"width: 223.75pt; border-top: none; border-right: none; border-left: none; border-image: initial; border-bottom: 1pt solid black; padding: 2.75pt;\"><p class=\"DefinitionDescription\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><b><span lang=\"EN-US\">Mobile App</span></b><span lang=\"EN-US\"><o:p></o:p></span></p></td><td width=\"307\" valign=\"top\" style=\"width: 230.3pt; border-top: none; border-right: none; border-left: none; border-image: initial; border-bottom: 1pt solid black; padding: 2.75pt;\"><p class=\"DefinitionDescription\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">that you are currently using, and any sub-domains including mobile applications of this site unless expressly excluded by their own terms and conditions.<o:p></o:p></span></p></td></tr></tbody></table><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;2. </span><span lang=\"EN-GB\">In this privacy policy, unless the context requires a different interpretation:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;a. </span><span lang=\"EN-GB\">the singular includes the plural and vice versa;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;b. </span><span lang=\"EN-GB\">references to sub-clauses, clauses, schedules or appendices are to sub-clauses, clauses, schedules or appendices of this privacy policy;<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"right\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-align: right; text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;c. </span><span lang=\"EN-GB\">a reference to a person includes firms, companies, government entities, trusts and partnerships;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;d. </span><span lang=\"EN-GB\">\"including\" is understood to mean \"including without limitation\";<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;e. </span><span lang=\"EN-GB\">reference to any statutory provision includes any modification or amendment of it;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;f. </span><span lang=\"EN-GB\">the headings and sub-headings do not form part of this privacy policy.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Scope of this privacy policy<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;3. </span><span lang=\"EN-GB\">This privacy policy applies only to the actions of </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> and Users with respect to this </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">. It does not extend to any </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">s that can be accessed from this </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">including, but not limited to, any links we may provide to social media </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">s.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Data collected<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;4. </span><span lang=\"EN-GB\">We may collect the following Data, which includes personal Data, from you:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;a. </span><span lang=\"EN-GB\">Name<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;b. </span><span lang=\"EN-GB\">Contact Information such as email addresses<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;c. </span><span lang=\"EN-GB\">IP address (automatically collected);<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;d. </span><span lang=\"EN-GB\">Web browser type and version (automatically collected);<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;e. </span><span lang=\"EN-GB\">Operating system (automatically collected);<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;f. </span><span lang=\"EN-GB\">Location Data<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;g. </span><span lang=\"EN-GB\">in each case, in accordance with this privacy policy.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Our use of Data<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;5. </span><span lang=\"EN-GB\">For purposes of the Data Protection Act 1998, </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> is the \"data controller\".<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;6. </span><span lang=\"EN-GB\">We will retain any Data you submit for 12 months.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;7. </span><span lang=\"EN-GB\">Unless we are obliged or permitted by law to do so, and subject to any third party disclosures specifically set out in this policy, your Data will not be disclosed to third parties. This includes our affiliates and/or other companies within our group.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;8. </span><span lang=\"EN-GB\">All personal Data is stored securely in accordance with the principles of the Data Protection Act 1998. For more details on security see the clause below (<b>Security</b>).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;9. </span><span lang=\"EN-GB\">Any or all of the above Data may be required by us from time to time in order to provide you with the best possible service and experience when using our </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">. Specifically, Data may be used by us for the following reasons:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;a. </span><span lang=\"EN-GB\">internal record keeping;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;b. </span><span lang=\"EN-GB\">Use of the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">/application;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 1cm; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;c. </span><span lang=\"EN-GB\">Improving the service<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">in each case, in accordance with this privacy policy.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Third-party </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">s and services<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;10. </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> may, from time to time, employ the services of other parties for dealing with certain processes necessary for the operation of the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">. The providers of such services have access to certain personal Data provided by Users of this </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;11. </span><span lang=\"EN-GB\">Any Data used by such parties is used only to the extent required by them to perform the services that we request. Any use for other purposes is strictly prohibited. Furthermore, any Data that is processed by third parties will be processed within the terms of this privacy policy and in accordance with the Data Protection Act 1998.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Changes of business ownership and control<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;12. </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> may, from time to time, expand or reduce our business and this may involve the sale and/or the transfer of control of all or part of </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\">. Data provided by Users will, where it is relevant to any part of our business so transferred, be transferred along with that part and the new owner or newly controlling party will, under the terms of this privacy policy, be permitted to use the Data for the purposes for which it was originally supplied to us.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;13. </span><span lang=\"EN-GB\">We may also disclose Data to a prospective purchaser of our business or any part of it.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;14. </span><span lang=\"EN-GB\">In the above instances, we will take steps with the aim of ensuring your privacy is protected.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Controlling use of your Data<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;15. </span><span lang=\"EN-GB\">Wherever you are required to submit Data, you will be given options to restrict our use of that Data. This may include the following:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;16. </span><span lang=\"EN-GB\">use of Data for direct marketing purposes; and<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;17. </span><span lang=\"EN-GB\">sharing Data with third parties.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">The functionality of the </span><span lang=\"EN-US\">Mobile App<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;18. </span><span lang=\"EN-GB\">To use all features and functions available on the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">, you may be required to submit certain Data.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Accessing your own Data<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;19. </span><span lang=\"EN-GB\">You have the right to ask for a copy of any of your personal Data held by </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> (where such Data is held) on payment of a small fee, which will not exceed 35.00.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Security<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;20. </span><span lang=\"EN-GB\">Data security is of great importance to </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> and to protect your Data we have put in place suitable physical, electronic and managerial procedures to safeguard and secure Data collected via this </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;21. </span><span lang=\"EN-GB\">If password access is required for certain parts of the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">, you are responsible for keeping this password confidential.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;22. </span><span lang=\"EN-GB\">We endeavor to do our best to protect your Personal Data. However, the transmission of information over the internet is not entirely secure and is done at your own risk. We cannot ensure the security of your Data transmitted to the </span><span lang=\"EN-US\">Mobile App</span><span lang=\"EN-GB\">.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">General<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;23. </span><span lang=\"EN-GB\">You may not transfer any of your rights under this privacy policy to any other person. We may transfer our rights under this privacy policy where we reasonably believe your rights will not be affected.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;24. </span><span lang=\"EN-GB\">If any court or competent authority finds that any provision of this privacy policy (or part of any provision) is invalid, illegal or unenforceable, that provision or part provision will, to the extent required, be deemed to be deleted, and the validity and enforceability of the other provisions of this privacy policy will not be affected.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;25. </span><span lang=\"EN-GB\">Unless otherwise agreed, no delay, act or omission by a party in exercising any right or remedy will be deemed a waiver of that, or any other, right or remedy.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;26. </span><span lang=\"EN-GB\">This Agreement will be governed by and interpreted according to the law of England and Wales. All disputes arising under the Agreement will be subject to the exclusive jurisdiction of the English and Welsh courts.<o:p></o:p></span></p><h2 style=\"margin: 10pt 0cm; line-height: 19.9333px; break-after: avoid; font-size: 13pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">Changes to this privacy policy<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">&nbsp;27. </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> reserves the right to change this privacy policy as we may deem necessary from time to time or as may be required by law. Any changes will be immediately posted on the </span><span lang=\"EN-US\">Mobile App and</span><span lang=\"EN-GB\">&nbsp;you are deemed to have accepted the terms of the privacy policy on your first use of the </span><span lang=\"EN-US\">Mobile App following</span><span lang=\"EN-GB\">&nbsp;the alterations.<br></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt 14.15pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10); text-indent: -14.15pt;\"><span lang=\"EN-GB\">You may contact </span><span lang=\"EN-US\">Popkart App</span><span lang=\"EN-GB\"> by email at <a href=\"mailto:popkartcustomerservice@gmail.com\" target=\"_blank\" style=\"color: blue; text-decoration-line: underline;\"><span style=\"font-size: 13.5pt; line-height: 20.7px; font-family: &quot;Segoe UI&quot;, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">popkartcustomerservice@gmail.com</span></a><br><br><br><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 10);\"><span lang=\"EN-GB\">&nbsp;</span></p>', '2022-02-24 10:25:13', '2022-06-30 10:10:03');
