INSERT INTO `pakages` (`id`, `name`, `price`, `share_list`, `edit_list`, `price_visiblity`, `reward_access`, `health_access`, `google_ads`, `discription`, `created_at`, `updated_at`, `validity`) VALUES
(29, 'Free version', '0', '4', '1', 'No', 'No', 'No', 'Yes', '<ol>\r\n	<li>Able to create the grocery list.</li>\r\n	<li>Able to share the grocery list with 4 friends only.</li>\r\n	<li>Able to mark the favorite item for quick access in the future.</li>\r\n	<li>Able to add a reminder on the calendar like when the shopping date is going to be.</li>\r\n	<li>The user will not be able to edit the shopping list once it is saved (applicable for both the main user and sub-member of the list).</li>\r\n	<li>The user will not be able to see the price of the items added.</li>\r\n	<li>Ads: It will be Google ads</li>\r\n</ol>', '2022-02-24 10:32:16', '2022-04-26 08:50:16', 999999),
(30, '99 Cent Version(One-time payment)', '0.99', '10', '1', 'Yes', 'Yes', 'No', 'Yes', '<p>One Time Payment<br />\r\nAble to create the grocery list.<br />\r\nThe users will be able to edit the shopping list.<br />\r\nThe user will be able to share the grocery list with 10 friends.&nbsp;<br />\r\nAble to mark the favorite item for quick access in the future.<br />\r\nThe user will be able to add reward card pictures for future records.<br />\r\nThe user will be able to view the price info of products added to the shopping list with the total amount.<br />\r\nAble to add a reminder on the calendar like when the shopping date is going to be.<br />\r\nThe main user will be able to edit the grocery list on the shopping days (It implies the list can be edited only one time by the main user).<br />\r\nThe user will able to see the price of the items added.<br />\r\nAds: It will be Google ads</p>', '2022-02-24 10:36:28', '2022-04-22 13:19:39', 30),
(31, 'Pro Membership', '2', 'Unlimited', 'Unlimited', 'Yes', 'Yes', 'Yes', 'No', '<p>One Time Payment<br />\r\nAble to create the grocery list.<br />\r\nThe users will be able to edit the shopping list.<br />\r\nThe user will be able to share the grocery list with an unlimited number of friends.&nbsp;<br />\r\nAble to mark the favorite item for quick access in the future.<br />\r\nThe user will be able to add reward card pictures for future records.<br />\r\nThe user will be able to view the price info of products added to the shopping list with the total amount.<br />\r\nAble to add a reminder on the calendar like when the shopping date is going to be.<br />\r\nThe main user will be able to edit the grocery list on the shopping days (It implies the list can be edited only one time by the main user).<br />\r\nThe user will able to see the price of the items added.<br />\r\nHealth suggestion feature: allow admin to add the health-related posts that users can view.<br />\r\nAds: It will be Google ads</p>', '2022-02-24 10:38:06', '2022-04-21 08:58:28', 30);
